// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

contract Inventory {
    uint256 public stock = 0;
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    function getStock() public view returns (uint256) {
        return stock;
    }

    function increaseStock(uint256 amount) public onlyOwner {
        stock += amount;
    }

    function buyStock(uint256 amount) public payable {
        require(msg.value == amount * 1 ether, "Incorrect payment amount");

        require(stock >= amount, "Insufficient stock");
        stock -= amount;

        payable(owner).transfer(msg.value);
    }

    modifier onlyOwner {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }
}
